cy.request({
  url: 'https://api.realworld.io/api/users/login',
  method: 'POST',
  status: 200,
  body: {
    user: {
      email: 'matheus.santos.ciencia@gmail.com',
      password: '880112'
    }
  }
}).then(response => {
  console.log(response);
  expect(response.status).to.eq(200);
});

cy.request({
  url: 'https://api.realworld.io/api/users/login',
  failOnStatusCode: false,
  method: 'POST',
  status: 403,
  statusText: 'Forbidden',
  body: {
    user: {
      email: 'matheus.santos.cienciaa@gmail.com',
      password: '880112'
    }
  }
}).then(response => {
  console.log(response);
  expect(response.status).to.eq(403);
  expect(response.body.errors["email or password"][0]).to.have.eq('is invalid');
});

cy.request({
  url: 'https://api.realworld.io/api/users/login',
  failOnStatusCode: false,
  method: 'POST',
  status: 500,
  body: {
    "errors": {
      "password": ["can't be blank"]
    }
  }
}).then(response => {
  console.log(response);
  expect(response.status).to.eq(500);
  expect(response.body).to.have.eq("Cannot read properties of undefined (reading 'email')");
});

cy.request({
  url: 'https://api.realworld.io/api/users/login',
  failOnStatusCode: false,
  method: 'POST',
  status: 500,
  statusText: 'Forbidden',
  body: {
    "errors": {
      "email": ["can't be blank"]
    }
  }
}).then(response => {
  console.log(response);
  expect(response.status).to.eq(500);
